import { Box, Button, Header, Heading, Text,Grommet, DataTable, Table, TableHeader, TableCell, TableBody, TableRow, ResponsiveContext } from 'grommet';
import { Hpe, Previous, Filter } from 'grommet-icons';
import React, { useState, useEffect } from 'react';
import {useHistory} from 'react-router-dom';
import Foooter from './Foooter';

function Dashboard() {

  let history = useHistory();

  const theme = {
    global: {
      colors: {
        brand: '#01A982',
      },
      font: {
        family: 'Roboto',
        size: '18px',
        height: '20px',
      },
    },
  };
  const size = React.useContext(ResponsiveContext);

  const [notes, setNotes] = useState([{
      Device_Requestor: '',
      Device_PR_No: '',
      Device_PO_No: ''
  }])

  useEffect(() => {
      fetch("/dashboard").then(res => {
        if(res.ok) {
          return res.json()
        }
      }).then(jsonRes => setNotes(jsonRes));
  })

  console.log(setNotes);


  function Tablee(props){
    return(
      <Table>
        <TableRow>
          <TableCell>requestor={props.requestor}</TableCell>
          <TableCell>pr_no={props.pr_no}</TableCell>
          <TableCell>po_no={props.po_no}</TableCell>
        </TableRow>
      </Table>
    );
  }

  return(
      <>
      <Grommet theme={theme}>
      <Header background="brand">
          <Box direction="row" gap="small" pad="medium">
              <Hpe color="White"/>
              <Text weight="bold">HPE</Text>
              <Text>Dashboard</Text>
          </Box>
      </Header>  
      
      <Box alignSelf="center"  border={{ color: 'brand', size: 'medium' }} >
        <Box pad="small">
            <Button icon={<Previous />} alignSelf="start" onClick={() => history.goBack()}/>
            <Heading margin={{left: 'medium'}} >Dashboard</Heading>
        </Box>
        

        <Box direction="column" alignSelf="start" gap="medium" pad="medium"> 
        <Box direction={size !== 'small' ? 'row' : 'column'} align="center" gap="small" >
          <Button label="Filter" icon={<Filter />} reverse="true" />
        </Box>
            <Box direction="column">

            <DataTable
                columns={[
                  {
                    property: 'requestor',
                    header: <Text>Requestor</Text>,
                    primary: true,
                  },
                  {
                    property: 'pr_no',
                    header: <Text>PR Name</Text>,
                    primary: true,
                  },
                  {
                    property: 'po_no',
                    header: <Text>PO Name</Text>,
                    primary: true,
                  },
                  
                ]}
                data={[
                  { requestor: 'Alan', pr_no: '12345', po_no: '12345' },
                  { requestor: 'Alan', pr_no: '12345', po_no: '12345' },
                ]}
                />

              {/* {notes.map(note => 
              <Box>
              <Table>
                <TableHeader>
                  <TableCell>Requestor</TableCell>
                  <TableCell>PR Number</TableCell>
                  <TableCell>PO Number</TableCell>
                </TableHeader>
                <TableRow>
                  <TableCell>{note.Device_Requestor}</TableCell>
                  <TableCell>{note.Device_PR_No}</TableCell>
                  <TableCell>{note.Device_PO_No}</TableCell>
                </TableRow>
              </Table>
              </Box>
                )} */}

              {/* <ul>
                  <li>{note.Device_Requestor} {              } {note.Device_PR_No} {             } {note.Device_PO_No}</li>
                  <li>{note.Device_PR_No}</li>
                  <li>{note.Device_PO_No}</li>
              </ul> */}
              </Box>
              
          
           
        </Box>
      </Box>
      <Foooter />
    </Grommet>
  </>
  );
}

export default Dashboard;
